  03> HOLDEN, Huia Maria
  b 26.07.1978
  Huia was educated at Woodford House and King's College, Auckland, and is now studying at
  Lincoln University towards a Bachelor of Parks, Recreation and Tourism Management degree.
  02> WILLIAMS, Rodney Heathcote m on 03.09.1971 to COLLINS, Patricia Joan
  b 19.08.1950
  b 08.10.1951
  Rodney b. at Waipiro Bay and m., at Ulverstone, Gisborne. Patricia, d/o Rodney William Collins and
  Eira Williams, b, at Gisborne. Address: Matapouri Road, RD 3, Whangarei.
  Rodney was educated at Hereworth and Wanganui Collegiate School and farmed in Gisborne and Hawkes
  Bay. He has been a committee member of the Tutukaka Game Fishing Club for eight years and is
  presently Matapouri Bay Coordinator for the Tutukaka Coastguard.
  Patricia was educated at Nga Tawa, Marton (1964-69). She graduated from the Northland School of
  Nursing as an enrolled nurse in 1989 and became a registered comprehensive nurse in 1996. She is
  now a theatre nurse at the Whangarei Hospital.
  01> WILLIAMS, Alisa Jayne
  b 03.03.1972
  Alisa b. at Hunterville. She attended Iona College (1988-89) and Kamo High School (1990) and
  obtained a Certificate in Catering from the Northland Polytechnic in 1991 and worked as an
  assistant in a cafe in Whangarei. She qualified as a registered nanny and worked full-time as
  a nanny in Auckland. She is now training to be a beautician.
  02> WILLIAMS, Michael Ormond and COCHRANE , Hayley
  b 01.01.1974
  b ** ** ****
  Michael b. at Gisborne. He was educated at Kamo High School and qualified as a mechanic in
  1996.
  01> COCHRANE/WILLIAMS, Michaela
  b 25.09.1997
  03> WILLIAMS, Robyn m on 09.03.1973 to KIRKPATRICK, Ian Andrew
  b 10.08.1952
  b 24.05.1946
  Robyn b. at Waipiro Bay, East Coast and m. at Ngatapa. Ian, s/o David Alexander (Sandy) Kirkpatrick
  and Kathleen Walker, b, at Gisborne. Address: RD 2, Ngatapa, Gisborne.
  Robyn was educated at Queenswood School and Woodford House. She designs and makes children's
  clothes fashion clothing under the Frivolo label.
  Ian was educated at King's College (head prefect, 1st rugby XV 1962-64) and is a mixed cropping,
  sheep and cattle farmer on "Blueberry Hill" at Ngatapa near Gisborne. He played rugby for the All
  Blacks from 1967 to 1977 and was captain in 1972 and 1973. He was awarded the MBE in 1980.
  Bibliography
  "Kirky", Lindsay Knight, Rugby Press, 1979.
  01> KIRKPATRICK, Amanda Margaret
  b 15.10.1975
  Amanda b. at Gisborne. She was educated at Woodford House and Gisborne Girls' High School and
  studied horticulture in Palmerston North. She is presently working in Hawkes Bay.
